import React, { Fragment } from "react";
import { Link } from "react-router-dom"

import { ReactComponent as Logo } from "../../assets/MA.svg"

import { 
    NavigationContainer, 
    NavigationLinks, 
    NavigationLogo,
} from "./styles";

const Navigation = () => {

    return (
        <Fragment>
            <NavigationContainer>
                <NavigationLogo to="/">
                    <Logo />
                </NavigationLogo>

                <NavLinks>          
                    <NavLink to="/home">
                        HOME
                    </NavLink>

                    <NavLink to="/about">
                        ABOUT ME
                    </NavLink>



                </NavLinks>

                { isCartOpen && <CartDropdown/> }
            </NavigationContainer>

            <Outlet />
        </Fragment>
    );
}

export default Navigation;
